import React from 'react';
import logo from './logo.svg';
import js from './js.svg';
import './App.css';

const formatName = (user) => `${user.firstName} ${user.lastName}`;
const user = { firstName: 'John', lastName: 'Santucci'};
const element = (<h1>Hello, {formatName(user)}!</h1>);

function App() {
  return (
    <div className="App">
      <div class="container">
        <header className="App-header">
          <div class="flexContainer">
            <div class="flex3Column red"></div>
            <div class="flex3Column yellow">
              <img src={logo} className="App-js" alt="js" />
              <img src={logo} className="App-logo" alt="logo" />
            </div>
            <div class="flex3Column green"></div>
          </div>
          { element }
          <a className="App-link"
            href="https://jsongithub.github.io/portfolio/"
            target="_self"
            rel="noopener noreferrer"
          >
            portfolio
          </a>
        </header>
      </div>
    </div>
  );
}

export default App;
